import React from "react";
import * as ReactDOMClient from "react-dom/client";
import ReactDOM from "react-dom";
import App from "./app";
import "./css/main.css";

const app = ReactDOMClient.createRoot(document.getElementById("main"));
app.render(<App />);

class Nam extends React.Component {
  state = {
    val: 0,
  };

  increaseCounter = () => {};

  render() {
    return (
      <div>
        <button type="button">-1</button>
        <label>{this.val}</label>
        <button type="button">+1</button>
      </div>
    );
  }
}
const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(<Nam />);
